__NUXT_JSONP__("/drugs/Nemvaleukin_Alfa", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"2315268-27-8",chebiId:b,chemicalFormula:b,definition:"A selective effector cell activator protein and agonist of the intermediate-affinity interleukin-2 (IL-2) receptor with potential immunostimulating and antineoplastic activity. Upon administration, nemvaleukin alfa binds to and signals through the intermediate-affinity IL-2 receptor complex; this may selectively stimulate and activate natural killer (NK) cells and memory CD8 T-cells, leading to tumor cell elimination, while circumventing the activation of immunosuppressive cells that may prevent the anti-tumor response. IL-2 is a cytokine signaling molecule that plays a critical role in the immune response.",fdaUniiCode:"7ZX1Q9SJ1F",identifier:"C128107",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C129825","C2139"],synonyms:["ALKS 4230","Intermediate-affinity IL-2R Agonist ALKS 4230","Intermediate-affinity Interleukin-2 Receptor Agonist ALKS 4230","NEMVALEUKIN ALFA",c,"RDB 1450","RDB-1450"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FNemvaleukin_Alfa",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("Nemvaleukin_Alfa","","Nemvaleukin Alfa","2021-10-30T13:31:03.093Z")));